import React, { Component } from "react";
import Multiplex from "./Multiplex"
const list = [
  "一个小游戏",
  "无聊的小游戏",
  "javaScript的程序设计"
]
const style={
  background:"red"
}
export default class App extends Component {
  render() {
    return <div><Multiplex data={list} style={style}/></div>;
  }
}
